pragma solidity ^0.8.10;
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

library Shared {
    struct RealState {
        string city;
        string street;
        uint number;
        uint meters;
        uint registration;
        string owner;
        uint price;
    }
}

contract RealStateContractCities {

    struct HistoricalData {
        string city;
        string street;
        uint number;
        uint meters;
        uint registration;
        string owner;
        uint timestamp;
        address requester;
        uint price;
    }

    AggregatorV3Interface internal priceFeed;

    HistoricalData[] public globalHistoricalData;
    
    mapping( string => Shared.RealState[]) public realStateMap;

    mapping( string => mapping( string => Shared.RealState[])) public realStateMapMap;

    address public administrator;
    mapping(address => bool) public authorizedAddresses;

    mapping(string => HistoricalData[]) public historicalDataMap;

    function getRealStateByCity (string calldata _city) public view returns(Shared.RealState[] memory) {
        return realStateMap[_city];
    }

   function addRealState(Shared.RealState calldata realState) public {
        HistoricalData memory historicalData = HistoricalData({
            city: realState.city,
            street: realState.street,
            number: realState.number,
            meters: realState.meters,
            registration: realState.registration,
            owner: realState.owner,
            timestamp: block.timestamp,
            requester: msg.sender,
            price: realState.price 
        });

        globalHistoricalData.push(historicalData);
        historicalDataMap[realState.city].push(historicalData);
        removeExistingRealState(realState);
        realStateMap[realState.city].push(realState);

        //int ethUsdPrice = getEthUsdPrice();
    }

    function removeExistingRealState(Shared.RealState calldata realState) internal {
    Shared.RealState[] storage existingRealStates = realStateMap[realState.city];

    for (uint i = 0; i < existingRealStates.length; i++) {
        if (existingRealStates[i].registration == realState.registration) {
            delete existingRealStates[i];
            if (i < existingRealStates.length - 1) {
                existingRealStates[i] = existingRealStates[existingRealStates.length - 1];
            }
            existingRealStates.pop();
            break;
        }
    }
    }



    constructor() {
        administrator = msg.sender;
        authorizedAddresses[msg.sender] = true;
        priceFeed = AggregatorV3Interface(0x5f4eC3Df9cbd43714FE2740f5E3616155c5b8419);
    }

    function isAdministrator() public view returns (bool) {
        return msg.sender == administrator;
    }

    function addAuthorizedAddress(address _authorizedAddress) public  {
        require(msg.sender == administrator, "Only the administrator can call this function");
        authorizedAddresses[_authorizedAddress] = true;
    }

    function getEthUsdPrice() public view returns (int) {
        (, int price, , ,) = priceFeed.latestRoundData();
        return price;
    }

    function getGlobalHistoricalData() public view returns (HistoricalData[] memory) {
        return globalHistoricalData;
    }

}


contract RealStateContract{

    struct RealState {
        string city;
        string street;
        uint number;
        uint meters;
        uint registration;
        string owner;
        uint price;
    }

    RealState[] public realStateArray;

    

function addRealState(string calldata _city, string calldata _street, 
        uint _number, uint _meters, uint _registration, string calldata _owner, uint _price) public {
    
    for(uint i = 0; i < realStateArray.length; i++){
        if (realStateArray[i].registration == _registration){
            if (i != realStateArray.length - 1) {
                realStateArray[i] = realStateArray[realStateArray.length - 1];
            }
            realStateArray.pop(); 
            break; 
        }
    }

    RealState memory re = RealState(_city, _street, _number, _meters, _registration, _owner, _price);
    realStateArray.push(re);
}


    function getRealStateByRegistration (uint _registration) public view returns(RealState memory) {
        for(uint i =0; i < realStateArray.length; i++){
            if (realStateArray[i].registration == _registration){
                return realStateArray[i];
            }
        }

         revert("Not found RealState with this registration");
    }

    function deleteRealStateByRegistration(uint _registration) public {
        for(uint i =0; i < realStateArray.length; i++){
            if (realStateArray[i].registration == _registration){
                delete realStateArray[i];

                for(uint j =i; j < realStateArray.length-1; j++){
                    realStateArray[j] = realStateArray[j+1];
                }

                realStateArray.pop(); // delete the last
                // Important to reduce -1 the leght of array

                return; // for finish method
            }
        }
    }

    function getRealStateByCity (string calldata _city) public view returns(RealState[] memory) {
       uint resultLength = 0;
        for(uint i =0; i < realStateArray.length; i++){
            if (keccak256(bytes(realStateArray[i].city)) == keccak256(bytes(_city))){
                resultLength++;
            }
        }
        RealState[] memory rsReturn = new RealState[](resultLength);
        uint positionInsert = 0;
        for(uint i =0; i < realStateArray.length; i++){
            if (keccak256(bytes(realStateArray[i].city)) == keccak256(bytes(_city))){
                rsReturn[positionInsert] = realStateArray[i];
                positionInsert++;
            }
        }
        return rsReturn;
    }
